css:
atom-text-editor.editor {
  background-color: #000000;
  color: #ffffff;
  font-weight: normal;
  opacity: 1;
}
atom-text-editor.editor .fold-marker::before {
  content: "";
  display: block;
  position: absolute;
  left: 0;
  right: 0;
  border-bottom: 1px dotted #fff;
  opacity: .15;
}
atom-text-editor.editor .editor .invisible-characters {
  opacity: 1;
}
atom-text-editor.editor .line.cursor-line .fold-marker::after {
  color: #ffffff;
}
atom-text-editor.editor .line.cursor-line .fold-marker::before {
  border-color: #ffffff;
}
atom-text-editor.editor .cursor {
  border-color: #fc0;
  border-width: 1px;
}
atom-text-editor.editor .bracket-matcher .region {
  border-bottom: 1px solid yellow;
}
atom-text-editor.editor .cursor-line {
  background-color: rgba(0, 0, 0, 0.1);
  width: 18px;
}
atom-text-editor.editor .line-number.foldable .icon-right {
  visibility: visible !important;
  color: #a5f56d !important;
  opacity: 1;
}
atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
atom-text-editor.editor .wrap-guide {
  background-color: #141414;
}
atom-text-editor.editor .indent-guide {
  color: #0d0d0d;
}
atom-text-editor.editor .invisible-character {
  color: #0d0d0d;
}
atom-text-editor.editor .gutter {
  background-color: #141414;
  color: #ffffff;
}
atom-text-editor.editor .line-number .cursor-line {
  background-color: #0d0d0d;
  color: #ffffff;
}
atom-text-editor.editor .line-number .cursor-line-no-selection {
  color: #ffffff;
}
atom-text-editor.editor .gutter .line-number {
  color: #ffffff !important;
  background-color: #000000;
  opacity: 1;
}
atom-text-editor.editor .gutter .line-number.folded,
atom-text-editor.editor .gutter .line-number:after,
atom-text-editor.editor .fold-marker:after {
  color: #777777;
}
atom-text-editor.editor .invisible {
  color: #ffffff;
}
atom-text-editor.editor .cursor {
  color: #22bbff;
}
atom-text-editor.editor .selection .region {
  background-color: #2e2e2e;
}
.syntax--comment {
  color: #777777;
}
.syntax--keyword {
  color: #00c3ff;
}
.syntax--keyword.syntax--control {
  color: #00c3ff;
}
.syntax--keyword.syntax--control.syntax--assignment {
  color: #c8e69e;
}
.syntax--keyword.syntax--operator {
  color: #ffffff;
}
.syntax--keyword.syntax--other.syntax--special-method {
  color: #ff64ff;
}
.syntax--keyword.syntax--other.syntax--unit {
  color: #ffc333;
}
.syntax--storage {
  color: #00c3ff;
}
.syntax--constant {
  color: #ffc333;
}
.syntax--constant.syntax--character.syntax--escape {
  color: #22bbff;
}
.syntax--constant.syntax--numeric {
  color: #ffc333;
}
.syntax--constant.syntax--other.syntax--color {
  color: #22bbff;
}
.syntax--constant.syntax--other.syntax--symbol {
  color: #cbfb89;
}
.syntax--variable {
  color: #00f3ff;
}
.syntax--variable.syntax--interpolation {
  color: #00c2cc;
}
.syntax--variable.syntax--parameter.syntax--function {
  color: #ffffff;
}
.syntax--invalid.syntax--illegal {
  background-color: #00f3ff;
  color: #000000;
}
.syntax--string {
  color: #cbfb89;
}
.syntax--string.syntax--regexp {
  color: #22bbff;
}
.syntax--string.syntax--regexp .syntax--source.syntax--ruby.syntax--embedded {
  color: #ffc333;
  color: #c8e69e;
}
.syntax--string.syntax--other.syntax--link {
  color: #00f3ff;
}
.syntax--punctuation.syntax--definition.syntax--comment {
  color: #777777;
}
.syntax--punctuation.syntax--definition.syntax--string {
  color: #ffffff;
}
.syntax--punctuation.syntax--definition.syntax--variable {
  color: #ffffff;
}
.syntax--punctuation.syntax--definition.syntax--parameters {
  color: #ffffff !important;
}
.syntax--punctuation.syntax--definition.syntax--array {
  color: #900 !important;
}
.syntax--punctuation.syntax--definition.syntax--heading {
  color: #900 !important;
}
.syntax--punctuation.syntax--definition.syntax--identity {
  color: #900 !important;
}
.syntax--punctuation.syntax--definition.syntax--bold {
  color: #900;
  font-weight: bold;
}
.syntax--punctuation.syntax--definition.syntax--italic {
  color: #900;
  font-style: italic;
}
.syntax--punctuation.syntax--section.syntax--embedded {
  color: #00c2cc;
}
.syntax--support.syntax--class {
  color: #fc0;
}
.syntax--support.syntax--function {
  color: #22bbff;
}
.syntax--support.syntax--function.syntax--any-method {
  color: #ff64ff;
}
.syntax--entity.syntax--name.syntax--function {
  color: #ff64ff;
}
.syntax--entity.syntax--name.syntax--type {
  color: #fc0;
  text-decoration: none !important;
  color: #c8e69e;
}
.syntax--entity.syntax--other.syntax--inherited-class {
  color: #cbfb89;
}
.syntax--entity.syntax--name.syntax--class,
.syntax--entity.syntax--name.syntax--type.syntax--class {
  color: #fc0;
}
.syntax--entity.syntax--name.syntax--section {
  color: #ff64ff;
}
.syntax--entity.syntax--name.syntax--tag {
  color: #00f3ff;
  text-decoration: none !important;
}
.syntax--entity.syntax--other.syntax--attribute-name {
  color: #ffc333;
}
.syntax--entity.syntax--other.syntax--attribute-name.syntax--id {
  color: #ff64ff;
}
.syntax--meta.syntax--class {
  color: #fc0;
}
.syntax--meta.syntax--link {
  color: #ffc333;
}
.syntax--meta.syntax--require {
  color: #ff64ff;
}
.syntax--meta.syntax--selector {
  color: #00c3ff;
}
.syntax--meta.syntax--separator {
  background-color: #0d0d0d;
  color: #ffffff;
}
.syntax--none {
  color: #ffffff;
}
.syntax--markup.syntax--bold {
  color: #ffc333;
  font-weight: bold;
}
.syntax--markup.syntax--changed {
  color: #00c3ff;
}
.syntax--markup.syntax--deleted {
  color: #00f3ff;
}
.syntax--markup.syntax--italic {
  color: #00c3ff;
  font-style: italic;
}
.syntax--markup.syntax--heading .syntax--punctuation.syntax--definition.syntax--heading {
  color: #ff64ff;
}
.syntax--markup.syntax--inserted {
  color: #cbfb89;
}
.syntax--markup.syntax--list {
  color: #00f3ff;
}
.syntax--markup.syntax--quote {
  color: #ffc333;
}
.syntax--markup.syntax--raw.syntax--inline {
  color: #cbfb89;
}
.syntax--source.syntax--gfm .syntax--markup {
  -webkit-font-smoothing: auto;
}
.syntax--source.syntax--gfm .syntax--markup.syntax--heading {
  color: #cbfb89;
}
.scrollbars-visible-always ::-webkit-scrollbar-track,
.scrollbars-visible-always ::-webkit-scrollbar-corner {
  background: #000000;
}
.scrollbars-visible-always ::-webkit-scrollbar-thumb {
  background: #fc0;
}
.syntax--underline {
  text-decoration: none !important;
}
